import { StyleSheet, Text, View } from 'react-native'
import tw from 'tailwind-react-native-classnames'
import React from 'react'

const Login = () => {
  return (
    <View style={tw`invisible`}>
      <Text>Login</Text>
    </View>
  )
}

export default Login

const styles = StyleSheet.create({})
